import React from 'react';
import Button from '@material-ui/core/Button'

type Props = {
  color: string;
  showFirstParagraph?: boolean;
  showSecondParagraph?: boolean;
};

export default function({
    color,
    showFirstParagraph,
    showSecondParagraph
}: Props) {
    return (
        <>
            {showFirstParagraph &&
            <Button color="primary">
            Test page
            </Button>
            }

            {showSecondParagraph &&
            <Button color="primary">
            Home
            </Button>
            }
        </>
    )
}
